import React from 'react';
import Test from './Test';
import logoImage from './logo.png';
import './App.js'


const customStyle = {
  color : "red",
  textShadow : "2px 2px 5px yellow",
  fontFamily: "Times New Roman",
  textAlignLast: "center",  
  fontWeight: "bold",
  padding: "0px 40px",

}

const App = () => {
  const customStyle = {
    color: "yellow", /* Replace with your desired color code */
    fontFamily: "Times New Roman",
    fontWeight: "bold",
    /* Other styles can be added or modified here */
  };

  return (
    <header className="bg-light mb-4">
      <div className="container">
        <div className="d-flex align-items-center">
          <img src={logoImage} alt="Company Logo" className="mr-3" width="100" height="100" />
          <h1 style={customStyle} className="font-weight-bold">Aptitude Test</h1>
        </div>
        <Test />
      </div>
    </header>
  );
};
export default App;
